import React from 'react';
import AlbumMaker from './components/AlbumMaker';
import BannerImage from './components/BannerImage';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <BannerImage />
        <div>
          <h1>Photojournal</h1>
          <h3>Peace is where your mind is !</h3>
          <AlbumMaker />
        </div>
      </header>
    </div>
  );
}

export default App;
